import React from 'react';
import './css/friends.css';

const Friends = ({imagem1, imagem2}) => {
    return (
        <div>
            <section>
               <p>Amigos { imagem1 } </p>
               <p>Nitro X { imagem2 } </p>
               <p>Mensagem Direta +</p>
               <div>
                   <div></div>
                   <p>Nome</p>
               </div>
            </section>
        </div>
    )
}

Friends.defaultProps = {
    imagem1: <img src="./imgs/boneco-icon.png" alt="bonecodisc"/>,
    imagem2: <img src="./imgs/nitro-icon.png" alt="nitro" srcset="" />,
}
export default Friends;
